import React from "react";

const Nav = (onClick) => {
  return (
    <div className="navbar">
      <h1>Youth Power</h1>
      <ul className="navButtons">
        <li className="primary-btn" onClick={onClick}>
          Join
        </li>
        <li className="primary-btn">Donate</li>
      </ul>
    </div>
  );
};

export default Nav;
